:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, Emma Caroline and NELSON, William
  INELSON, Lionel (Jack) and CHAMBERS, Esther Margaret
  INELSON, Hugh Douglas and SMITH, Cynthia Helen Margaret
  NELSON. Hugh Douglas and SMITH, Cynthia Helen Margaret (cont...)
  Hugh was educated at Wanganui Collegiate School (1927-31) and Canterbury University College (1931-35) and
  graduated as BE(Mech)(Hons). He worked as an engineer in UK, Europe and New Zealand (1935-43) then served
  with the Indian Army finishing as Chief Instructor, Major, at the SME, Roorkee, India (1944-47), He worked
  as a chemical engineer with an American international company in Nassau, Bahamas (1947-55). In 1955 he
  founded Ornel Pump Co Pty Ltd in Australia which specialised in the designing and manufacture of pumps
  mainly for irrigation. He qualified as a Fellow of the IMechE(UK) and was awarded the Prince Philip prize
  for Australian Industrial Design. He was President of the Australian Pump Manufacturers' Association and
  presented technical papers in Australia, UK and Singapore. He travelled worldwide designing irrigation and
  supplying pumps in Africa, Middle East and South East Asia. From 1976-80 he was consulting for a pump
  manufacturer in UK. His leisure interests are mountaineering and sailing.
  Cynthia was a teacher and later a voluntary guide at the Sydney Art Gallery.
  01> NELSON, Jennifer Helen m on 05.10.1963 to HUNT, John Hamilton
  b 24.02.1940
  b 16.11.1934
  Jennifer b. at Wellington and m. at Sydney, Australia. Separated 1989 and divorced 1993. John, slo
  James Threlfall Hunt and Edna Hogbin, b. at Nyngan, NSW. Address: 2/189 Coode Street, Como 6152, (PO
  Box 759, Subiaco 6904), WA, Australia; Email: jenniehh@ozemail.com.au
  Jennie trained as a radiographer and worked in a variety of settings before marriage and during the
  years of marriage. In 1986 she gained a certificate in welfare work. Since then she has graduated
  twice, first gaining a Graduate Diploma in Social Communication at Hawkesbury Agricultural College and
  in 1994 a Masters Degree in Social Ecology at the University of Western Sydney - Hawkesbury. Since
  1986 Jennie has worked in the specialised area of Alzheimer's disease and the related disorders, both
  in practical care settings and in management as the Executive Director of the Alzheimer's Association
  WA. Currently she is the specialist aged care lecturer at Central Metropolitan College of TAFE in
  Perth.
  Jennie enjoys choral singing and has been a member of the Sydney Philharmonia and Perth Oratorio
  Choirs. She has sung on three occasions with the World Festival Choir in Sydney and Verona, Italy.
  She is an active member of Rotary and also enjoys outdoor activities such as tramping, cycling and
  tennis.
  John is the Director of Radiology at the Royal North Shore Hospital in Sydney.
  01> HUNT, Andrew James m on 20.10.1991 to DARVAS, Katherine Ann
  b 01.05.1965
  b 24.10.1965
  Address: 71 Jerome Street, Medford, Ma 02155, USA.
  Andrew graduated in Electrical Engineering from the University of New South Wales and Sydney
  University. He was an AFS exchange student in Malaysia. is now employed with Sun Microsystems in
  Boston, USA.
  Kate graduated in Pharmacy from Sydney University.
  01> HUNT, Stephanie Louise
  b 05.12.1997
  02> HUNT, Geoffrey Douglas
  b 27.04.1967
  Address: 5/25 Elamang Avenue, Kirribilli 2061, Sydney, NSW, Australia; Email: hunt@pams.com.au.
  Geoffrey was educated at Knox Grammar School in Sydney (1979-84). For the nine years after he left
  school, he worked as a recording engineer in the music business, spending seven of those years in
  London and another six months in New York. During those years he had the fortune to work with some
  of the world's biggest names, ranging from Tom Jones and Cliff Richard through to DJ Jazzy Jeff and
  the Fresh Prince and Massive Atack. In 1993 Geoffrey returned home to Sydney where he took six
  months off. He is now part owner of a multi-media company in Sydney that produces CD-ROMs and
  internet sites for the music and entertainment industries, Geoffrey won the award for Programmer
  of the Year at the 1997 Australian Multi-Media Industry Awards.
